import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { ApolloProvider } from "react-apollo";
import Login from './pages/Login';
import Dashboard from './pages/Dashboard';
import Logout from './pages/Logout';
import thHireApi from './utils/thHireAPi';
import { LOGIN, LOGOUT, DASHBOARD } from './constants/routes';
import { AuthCheck } from './hocs/AuthCheck/AuthCheck';

const App = () => {
  return (
      <>
      <ApolloProvider client={thHireApi}>
      <Router>
        <Switch>
          <AuthCheck exact path={DASHBOARD} component={Dashboard} />
          <AuthCheck exact path="/" component={Dashboard} />
          <Route exact path={LOGIN} component={Login} />
          <Route exact path={LOGOUT} component={Logout} />
        </Switch>
      </Router>
    </ApolloProvider>
    </>
  );
};

export default App;
